        """Add edges to the adjacency matrix."""
        for u, v in edges:#initially u=0,v=1.. as first list=[0,1]
            self.adj_matrix[u][v] = 1  #creating the edge from u to v.. edges creat hoise bole matrix er destination er idx=1 bosche
